    <style>
        html, body {
            margin: 0;
            position: relative;
            width: 100%;
            height: 100%;
            overflow: hidden;
            /*overflow-X: scroll;*/
            scrollbar-arrow-color: #a3662f; /*三角箭头的颜色*/
            scrollbar-face-color: #a3662f; /*立体滚动条的颜色*/
            scrollbar-3dlight-color: #a3662f;
            /*立体滚动条亮边的颜

           色*/
            scrollbar-highlight-color: #a3662f;
            /*滚动条空白部分的

           颜色*/
            scrollbar-shadow-color: #a3662f;
            /*立体滚动条阴影的颜

           色*/
            scrollbar-darkshadow-color: #a3662f;
            /*立体滚动条强阴

           影的颜色*/
            scrollbar-track-color: #a3662f; /*立体滚动条背景颜色*/

            scrollbar-base-color: #f8f8f8; /*滚动条的基本颜色*/
        }

        .animate {
            -webkit-animation: floor 1s linear infinite;
            -o-animation: floor 1s linear infinite;
            animation: floor 1s linear infinite;
            /*transition:all 0.3s;*/
        }

        @-webkit-keyframes floor {
            0% {
                fill: #fffff;
            }
            100% {
                fill: #a3662f;
            }
        }

        @keyframes floor {
            0% {
                fill: #ffffff;
            }
            100% {
                fill: #a3662f;
            }
        }

        /*rect{*/
        /*fill: #a3662f;*/
        /*}*/
        #detail p{
            margin-top:0;

        }
        #detail {
            position: fixed;
            bottom: 0;
            right: 0;
            width: 100%;
            height: 50px;
            background: rgba(103, 103, 103, 0.84);
            font-size: 16px;
            transition: all 0.5s ease;
            text-align:center;
        }

        .id {
            /*color: red;*/
        }

        #container {
            width: 100%;
            /*height: 80%;*/
            overflow: auto;
            transition: all 0.5s;
        }
        .infor{
            width: 100%;height: 100%;
            display:none;
            line-height:20px;
            color:#fff;

        }
        .infor .mar{

            margin-right: 20px;
        }

    </style>
